import { Morph, morph } from "lively.morphic";
import { connect, signal } from "lively.bindings/index.js";
import { Color, pt } from "lively.graphics/index.js";
import { Icons } from "lively.morphic/components/icons.js";

export default class IconHolder extends Morph {

  static get properties() {

     return {
         icons: {after: ['submorphs'], get() {
             return this._icons = this._icons || Object.keys(Icons).map(name => morph({
               onHoverIn() { this.fill = new Color.rgb(133,193,233) },
               onHoverOut() { this.fill = Color.transparent},
               onMouseDown() { 
                 signal(this.get('IconPicker'), 'select', name)
                 this.fill = this.fill.darker();
               },
               onMouseUp() { this.fill = new Color.rgb(133,193,233) },
               readOnly: true,
               type: "text", fontFamily: "FontAwesome", 
               textStyleClasses: ["fa"],
               fill: Color.transparent,
               tooltip: `${name}`, fontSize: 20, padding: 4, fixedWidth: true, extent: pt(40,40),
               textString: `${Icons[name].code}`}
             ));
           }
         }
       }
  }

  clear() {
     this._icons = [];
     this.submorphs = [];
  }

  onLoad() {
     this.submorphs = this.icons;
  }

  filterIcons(searchTerm) {
    this.submorphs = searchTerm === "" ?
      this.icons :
      this.icons.filter(icon =>  icon.tooltip.includes(searchTerm));
  }
}
